import React from "react";

const Home = () => {
  return (
    <section id="home" className="min-h-screen flex flex-col justify-center items-center bg-gradient-to-r from-indigo-500 to-purple-500 text-white">
      <h1 className="text-5xl font-bold mb-4 animate-bounce">Hi, I'm Angel</h1>
      <p className="text-xl mb-6">A Frontend Developer | MERN Stack Enthusiast</p>
      <a
        href="/assets/resume.pdf"
        download
        className="px-6 py-3 bg-white text-indigo-600 font-semibold rounded hover:bg-gray-200 transition"
      >
        Download Resume
      </a>
    </section>
  );
};

export default Home;
